import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import JournalEntryPage from './pages/JournalEntryPage';
import InsightsPage from './pages/InsightsPage';
import AuthPage from './pages/AuthPage';
import Dashboard from './pages/Dashboard'; // Import the Dashboard component
import { UserProvider } from './UserContext';

function App() {
  const [showPopup, setShowPopup] = useState(true);

  const handleClosePopup = () => {
    setShowPopup(false);
  };

  return (
    <UserProvider>
      <Router>
        <div className="App">
          {showPopup && (
            <div className="popup">
              <div className="popup-content">
                <h2>Welcome to Memory App!</h2>
                <p>Hereâ€™s how you can get started:</p>
                <ol>
                  <li><strong>Sign-In:</strong> Log in or create an account to begin.</li>
                  <li><strong>Enter Journal Entries:</strong> Use the journal page to write your thoughts.</li>
                  <li><strong>Search Entries:</strong> Find past entries using metadata and keywords.</li>
                  <li><strong>Get Insights:</strong> Receive personalized mental health tips and insights.</li>
                </ol>
                <button onClick={handleClosePopup}>Got it!</button>
              </div>
            </div>
          )}
          <Navbar />
          <Routes>
            <Route path="/" element={<Navigate to="/journal" />} />
            <Route path="/journal" element={<JournalEntryPage />} />
            <Route path="/authpage" element={<AuthPage />} />
            <Route path="/insights" element={<InsightsPage />} />
            <Route path="/dashboard" element={<Dashboard />} /> {/* Add Dashboard route */}
          </Routes>
        </div>
      </Router>
    </UserProvider>
  );
}

export default App;
